import React, { useEffect } from "react";
import api from "./api";

const App = () => {
    useEffect(() => {
        api.get("ativos/")
            .then((response) => {
                console.log(response.data);
            })
            .catch((error) => {
                console.error("Erro ao buscar ativos:", error);
            });
    }, []);

    return <div>Conectando React com Django...</div>;
};

export default App;
